import React, { useState } from 'react';

const InputElement = () => {
	const [inputTest, setInputText] = useState('');

	return (
		<div>
			<input
				type='text'
				placeholder='Enter some text'
				onChange={e => {
					setInputText(e.target.value);
				}}
			/>
			<br />
			{inputText}
		</div>
	);
};

export default InputElement;
